const MAXNUM = 10001

func output(length [][2502]int, n, i, prevIdx int) {
	fmt.Printf("-----i: %d, prevIdx: %d--------\n", i, prevIdx)
	for i := 0; i <= n; i++ {
		for j := 0; j <= n; j++ {
			fmt.Printf("%2d ", length[i][j])
		}
		fmt.Println()
	}
	fmt.Println()
}

func outputOne(length []int, n, i, prevIdx int) {
	fmt.Printf("-----i: %d, prevIdx: %d--------\n", i, prevIdx)
	for i := 0; i <= n; i++ {
		fmt.Printf("%2d ", length[i])
	}
	fmt.Println()
}

func Max(x, y int) int {
	if x > y {
		return x
	}
	return y
}

/**
  for 循环版本递归
*/
func lengthOfLISForRecur(nums []int) int {

	ans, n := 0, len(nums)

	var search func(i int) int
	search = func(i int) int {
		if i == n {
			return 0
		}
		ans := 1
		for j := i + 1; j < n; j++ {
			if nums[j] > nums[i] {
				ans = Max(ans, search(j)+1)
			}
		}

		return ans
	}
	for i := 0; i < n; i++ {
		ans = Max(ans, search(i))
	}
	return ans
}

/**
  for 循环版本记忆化搜索
*/
func lengthOfLISFor(nums []int) int {
	ans, n := 0, len(nums)
	length := make([]int, n+1)
	var search func(i int) int
	for i := 0; i < n+1; i++ {
		length[i] = -1
	}
	search = func(i int) int {
		if i == n {
			return 0
		}
		ans := 1
		for j := i + 1; j < n; j++ {
			if nums[j] > nums[i] {
				if length[j] == -1 {
					length[j] = search(j)
				}
				ans = Max(ans, length[j]+1)
			}
		}
		return ans
	}
	for i := 0; i < n; i++ {
		if length[i] > -1 {
			continue
		}
		ans = Max(ans, search(i))
	}
	return ans
}

/**
  双参数递归
*/
func lengthOfLISRecur(nums []int) int {
	const MAXNUM = 10001
	n := len(nums)
	nums = append(nums, -10001)

	var search func(i, prev int) int
	search = func(i, prev int) int {
		if i == n {
			return 0
		}
		if prev == -1 {
			prev = n
		}
		selected := 0
		if nums[i] > nums[prev] {
			selected = search(i+1, i) + 1
		}
		unselected := search(i+1, prev)
		return Max(selected, unselected)
	}

	return search(0, -1)
}

/**
  双参数记忆化搜索 Map
*/
func lengthOfLISMap(nums []int) int {
	const MAXNUM = 10001
	n := len(nums)

	length := make([]map[int]int, n+1)
	for i := 0; i < n+1; i++ {
		length[i] = map[int]int{}
	}

	var search func(i, prev int) int
	search = func(i, prev int) int {
		if _, ok := length[i][prev]; ok {
			return length[i][prev]
		}

		if i == n {
			return 0
		}
		if _, ok := length[i+1][prev]; !ok {
			length[i+1][prev] = search(i+1, prev)
		}
		unselected := length[i+1][prev]

		selected := 0
		if nums[i] > prev {
			if _, ok := length[i+1][nums[i]]; !ok {
				length[i+1][nums[i]] = search(i+1, nums[i])
			}
			selected = length[i+1][nums[i]] + 1
		}
		length[i][prev] = Max(selected, unselected)
		return length[i][prev]
	}

	return search(0, -1*MAXNUM)
}

/**
  双参数记忆化搜索 Index
*/

func lengthOfLISIndex(nums []int) int {
	//const MAXNUM = 10001
	n := len(nums)
	nums = append(nums, -10001)

	length := make([][2502]int, n+1)
	for j := 0; j < n+1; j++ {
		for k := 0; k < 2502; k++ {
			length[j][k] = -1
		}
	}

	var search func(i, prevIdx int) int
	search = func(i, prevIdx int) int {
		if i == n {
			return 0
		}
		if prevIdx == -1 {
			prevIdx = n
		}
		if length[i][prevIdx] != -1 {
			return length[i][prevIdx]
		}
		selected := 0
		if nums[i] > nums[prevIdx] {
			if length[i+1][i] == -1 {
				length[i+1][i] = search(i+1, i)
			}
			selected = length[i+1][i] + 1
		}
		unselected := 0
		if length[i+1][prevIdx] == -1 {
			unselected = search(i+1, prevIdx)
		}
		length[i][prevIdx] = Max(selected, unselected)
		output(length, n, i, prevIdx)
		return length[i][prevIdx]
	}
	return search(0, -1)
}

/**
  双参数动态规划 [][2502]int
*/
func lengthOfLISDP2(nums []int) int {
	//const MAXNUM = 10001
	n := len(nums)

	length := make([][2502]int, n+1)
	for j := 0; j < n; j++ {
		for k := 0; k < 2502; k++ {
			length[j][k] = -1
		}
	}

	for i := n - 1; i >= 0; i-- {
		for j := i - 1; j >= 0; j-- {
			selected := 0
			if nums[i] > nums[j] {
				selected = length[i+1][i] + 1
			}
			unselected := length[i+1][j]
			length[i][j] = Max(selected, unselected)
			output(length, n, i, j)
		}
		length[i][i] = Max(length[i+1][i]+1, length[i+1][i+1])
		output(length, n, i, -1)
	}
	return length[0][0]
}

/**
  双参数动态规划 []int
*/
func lengthOfLIS1(nums []int) int {
	n := len(nums)
	length := make([]int, n+1)
	for i := n - 1; i >= 0; i-- {
		for j := i - 1; j >= 0; j-- {
			selected := 0
			if nums[i] > nums[j] {
				selected = length[i] + 1
			}
			unselected := length[j]
			length[j] = Max(selected, unselected)
			outputOne(length, n, i, j)
		}
		// max unselected selected
		length[i] = Max(length[i+1], length[i]+1)
		outputOne(length, n, i, -1)
	}
	return length[0]
}

func lengthOfLIS(nums []int) int {
	n := len(nums)
	length := make([]int, n+1)
	for i := n - 1; i >= 0; i-- {
		for j := 0; j <= i; j++ {
			if nums[i] > nums[j] {
				length[j] = Max(length[i]+1, length[j])
			}

		}
		length[i] = Max(length[i+1], length[i]+1)
	}
	return length[0]
}

